values:
Criteria: max up to 100 (Intonation 60% + Rhythm 30% + Tempo 10%) ;
Wrong Notes: wrong semitones + wrong notes;
Bad Beats: the number of wrong timing notes (ahead and behind).

values-ko:
기준 : 최대 100 점 (음정 60% + 리듬 30% + 템포 10%);
틀린 음정: 반음 편차 + 틀린 음정;
틀린 비트: 편차가 큰 템포.

values:
Criteria: the maximum intonation score is 100;
Common Range: < 20 cents;
Slightly Higher/Lower: < 70 cents;
Semitone Higher/Lower: > 70 cents and < 130 cents;
Very High/Low: offset > 130 cents;
Scoring: The more offset, the lower score;
Extra: each semitone offset/wrong note causes extra 4 dedicated points, max up to 20 points.
Cent (music):

values-ko:
기준: 최대 100 점.
표준 범위: < 20센트;
비교적 높음/낮음: < 70센트;
반음 높음/낮음:> 70센트, < 130센트;
틀린 음정:  > 130센트;
점수: 피치 편차가 심할수록 점수가 낮아짐.
부가: 반음/틀린 음정은 4점을 추가감점하는데 최대 20점까지.
센트:

values:
- The minimum unit of pitch height measurement;
- 100 cents equals to 1 semitone;
- Musicians can usually distinguish 20 cents offset.

Criteria: max up to 100;
Bad Beats: the Bad Beats (bad timing notes) are displayed in green/red;
Quaver/Semiquaver (8th/16th note): fault tolerance for 8th/16th notes are higher;
Quarter note: fault tolerance for quarter notes and the tolerance for other longer notes are lower; the offset over 1.5 times from a stable tempo is recognised as Bad Beats.

values-ko:
기준: 최대 100 점 
틀린 비트: 틑린 비트가 파란색/빨간색으로 표시됨;
8분음표/16분 음표: 8/16분 음표는 오류를 발생할 확률이 낮음;
4분음표: 4분음표는 오류를 발생할 확률이 높음.기타 긴 음표도 4분음표와 같음.1.5배 이상 편차는 틀린 비트로 인식됨.

values:
